import { BrowserRouter } from 'react-router-dom';
import Home from './home';
import Login from './login';
import Posts from './posts';

const Body = () => {
    return (
        <div className="body">
            <BrowserRouter>
            <Route exact path="/">
                <Home />
            </Route>
            <Route exact path="/posts">
                <Posts />
            </Route>
            <Route exact path='/login'>
                <Login />
            </Route>
            </BrowserRouter>
        </div>
    )
}

export default Body;
